const MONTHS = ['Jan','Feb','Mar','Apr','May','Jun','Jul','Aug','Sep','Oct','Nov','Dec'];

function formatDate(dateStr) {
  const d = new Date(dateStr + 'T00:00:00');
  return MONTHS[d.getMonth()] + ' ' + d.getDate();
}

function formatCurrency(val) {
  if (val >= 1000000) return '$' + (val / 1000000).toFixed(2) + 'M';
  if (val >= 1000) return '$' + (val / 1000).toFixed(1) + 'K';
  return '$' + val.toFixed(0);
}

function formatNumber(val) {
  return val.toLocaleString('en-AU');
}

// Map setup
const map = L.map('map', {
  center: [-28.5, 134],
  zoom: 5,
  zoomControl: false,
  attributionControl: false,
  minZoom: 4,
  maxZoom: 12
});

// Dark tile layer
L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
  subdomains: 'abcd',
  maxZoom: 20
}).addTo(map);

// Heat layer
let heatLayer = null;

function updateWeek(idx) {
  const week = DATA[idx];
  const from = week[0], to = week[1], total = week[2], orders = week[3], points = week[4];
  
  document.getElementById('weekLabel').textContent = 
    'Week ' + (idx + 1) + ': ' + formatDate(from) + ' — ' + formatDate(to);
  document.getElementById('totalSales').textContent = formatCurrency(total);
  document.getElementById('totalOrders').textContent = formatNumber(orders);
  document.getElementById('totalPostcodes').textContent = formatNumber(points.length);
  document.getElementById('weekSlider').value = idx;
  
  // Find max intensity for normalization
  let maxVal = 0;
  for (let i = 0; i < points.length; i++) {
    if (points[i][2] > maxVal) maxVal = points[i][2];
  }
  
  // Normalize points: [lat, lng, normalized_intensity]
  const normalized = points.map(p => [p[0], p[1], maxVal > 0 ? p[2] / maxVal : 0]);
  
  if (heatLayer) {
    heatLayer.setLatLngs(normalized);
  } else {
    heatLayer = L.heatLayer(normalized, {
      radius: 22,
      blur: 18,
      maxZoom: 10,
      max: 1.0,
      gradient: {
        0.0: '#000004',
        0.1: '#160b39',
        0.2: '#420a68',
        0.3: '#6a176e',
        0.4: '#932667',
        0.5: '#bc3754',
        0.6: '#dd513a',
        0.7: '#f37819',
        0.8: '#fca50a',
        0.9: '#f6d746',
        1.0: '#fcffa4'
      }
    }).addTo(map);
  }
}

// Controls
const slider = document.getElementById('weekSlider');
const playBtn = document.getElementById('playBtn');
const speedBtn = document.getElementById('speedBtn');

slider.addEventListener('input', () => updateWeek(parseInt(slider.value)));

let playing = false;
let playInterval = null;
const speeds = [1, 2, 4];
let speedIdx = 0;

function getDelay() {
  return [800, 400, 150][speedIdx];
}

function togglePlay() {
  playing = !playing;
  playBtn.textContent = playing ? '⏸' : '▶';
  
  if (playing) {
    playInterval = setInterval(() => {
      let val = parseInt(slider.value);
      val = (val + 1) % DATA.length;
      slider.value = val;
      updateWeek(val);
    }, getDelay());
  } else {
    clearInterval(playInterval);
  }
}

playBtn.addEventListener('click', togglePlay);

speedBtn.addEventListener('click', () => {
  speedIdx = (speedIdx + 1) % speeds.length;
  speedBtn.textContent = speeds[speedIdx] + '×';
  if (playing) {
    clearInterval(playInterval);
    playInterval = setInterval(() => {
      let val = parseInt(slider.value);
      val = (val + 1) % DATA.length;
      slider.value = val;
      updateWeek(val);
    }, getDelay());
  }
});

// Keyboard controls
document.addEventListener('keydown', (e) => {
  if (e.key === ' ' || e.key === 'Space') {
    e.preventDefault();
    togglePlay();
  } else if (e.key === 'ArrowRight') {
    let val = Math.min(parseInt(slider.value) + 1, DATA.length - 1);
    slider.value = val;
    updateWeek(val);
  } else if (e.key === 'ArrowLeft') {
    let val = Math.max(parseInt(slider.value) - 1, 0);
    slider.value = val;
    updateWeek(val);
  }
});

// Init
updateWeek(0);
</script>
